import React, { Component } from 'react';

const Columns = (props) => {
	const container = {
		width: '100%',
		display: 'grid',
		gridTemplateColumns: 'reapeat(3, 1fr)',
		gridTemplateRows: 'auto',
	};

	return <div style={container}>columns</div>;
};

export default Columns;
